// pages/Home.jsx
import React, { useState } from 'react';

function Home() {
  const [tripType, setTripType] = useState('round-trip');

  return (
    <div className="p-6">
      <div className="bg-white rounded-2xl shadow p-6">
        <h2 className="text-xl font-semibold mb-4">Flights</h2>
        <form className="space-y-4">
          <div className="flex gap-4">
            <label>
              <input
                type="radio"
                name="tripType"
                value="round-trip"
                checked={tripType === 'round-trip'}
                onChange={() => setTripType('round-trip')}
              />
              Round Trip
            </label>
            <label>
              <input
                type="radio"
                name="tripType"
                value="one-way"
                checked={tripType === 'one-way'}
                onChange={() => setTripType('one-way')}
              />
              One Way
            </label>
          </div>

          <div>
            <label className="block text-sm font-medium">Departure</label>
            <input type="date" className="mt-1 w-full border rounded px-3 py-2" />
          </div>

          {tripType === 'round-trip' && (
            <div>
              <label className="block text-sm font-medium">Return</label>
              <input type="date" className="mt-1 w-full border rounded px-3 py-2" />
            </div>
          )}

          <button type="submit" className="bg-blue-500 text-white px-4 py-2 rounded">
            Search
          </button>
        </form>
      </div>
    </div>
  );
}

export default Home;
